import React from 'react'
import { Route, BrowserRouter } from "react-router-dom";
import Home from '../components/Home'

const Routes = () =>  {
  return(
<><Routes>
        <BrowserRouter>
        
            <Route component = { Home }  path="/" exact />
            
        </BrowserRouter>
        </Routes>
       
</>
  ); 
}


export default Routes
